import BackGround from '../UI/BackGround';
import Card from '../UI/Card';
import CategoriesItem from '../categoriesPage/CategoriesItem';
import QuizQuestion from './QuizQuestion';

const Quiz = () => {
	return (
		<div>
			<BackGround />
			<Card className='content'>
				<QuizQuestion />
			</Card>
		</div>
	);
};

export default Quiz;
